// src/data/projectsData.ts
import mock10 from "../assets/images/mock10.png";
import PrivacyPolicy from "../components/PrivacyPolicy";

// Định nghĩa kiểu dữ liệu cho Project
export interface ProjectType {
  id: string; // ID dùng để làm URL (slug)
  title: string;
  image: string;
  description: string;
  link: string; // Link đến store hoặc web thật
  privacyContent: React.ReactNode; // Nội dung HTML/Text cho Privacy
  termsContent: React.ReactNode; // Nội dung HTML/Text cho Terms
}

export const projectsData: ProjectType[] = [
  {
    id: "easy-write-ai",
    title: "Easy Write AI",
    image: mock10,
    description:
      "Developed movie finder app with semantic search and sentiment analysis using OpenAI GPT-3.5 Turbo, Qdrant, React, and Flask.",
    link: "https://www.filmate.club/",
    // Bạn dán nội dung Privacy riêng của app này vào đây
    privacyContent: (
      <div>
        <h3>Privacy Policy for Easy Write AI</h3>
        <p>
          This privacy policy applies specifically to the Easy Write AI
          application...
        </p>
        <p>
          <strong>1. Data Collection:</strong> We collect...
        </p>
        {/* ...Dán phần còn lại của bạn vào đây... */}
      </div>
    ),
    // Bạn dán nội dung Terms riêng của app này vào đây
    termsContent: <PrivacyPolicy />,
  },
  // Bạn có thể thêm các project khác vào đây:
  // { id: "project-2", title: "Project 2", ... }
];
